The PPC Platform provides an interface to get a one‐time use access token authenticating a Network, Advertiser, or Affiliate user. The access token must then be appended to a PPC Platform destination URL. The network authenticates an organization by doing the following: Authenticates the user on the network Platform. Makes a server‐to‐server request for a one‐time use access token. Appends the returned access token to the PPC Platform destination URL access_token=<ProvidedAccessToken> Redirects to the PPC Platform destination URL. The format of the API URL is in (2): https://invoca.net/api/2014-­01-­01/<network_id>/network/<email>/create_access_token.json https://invoca.net/api/2014­-01-­01/<network_id>/advertisers/<advertiser_id_from_network>/<email>/create_access_token.json https://invoca.net/api/2014­-01-­01/<network_id>/affiliates/<affiliate_id_from_network>/<email>/create_access_token.json The success response is an JSON document with a root element of Response that contains a single AccessToken element whose content is the access token: Response JSON Element
Value AccessToken
The access token Example URLs Create access token for “ sy@young.com ” network user: POST https://invoca.net/api/2014­-01-­01/<network_id>/network/sy%40young.com/create_access_token.json HTTP/1.1 Response: { "token": "bpD8HmLcCxzSiOX01v­4XbZr4_s", "id": 1
} Create access token for “ sy@young.com ” user in advertiser id 354: POST https://invoca.net/api/2014­-01-­01/<network_id>/advertisers/354/sy%40young.com/create_access_token.json HTTP/1.1 Response: { "token": "bpD8HmLcCxzSiOX01v­4XbZr4_s", "id": 1
} Create access token for " sy@young.com " user in affiliate id 976: POST https://invoca.net/api/2014­-01-­01/<network_id>/affiliates/976/sy%40young.com/create_access_token.json HTTP/1.1 Response: { "token": "bpD8HmLcCxzSiOX01v­4XbZr4_s", "id": 1
}
